import React from 'react';

import { Text, Form, Button, Layout, Banner } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";

interface Props {
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const StyledContainer = styled(Layout.GridContainer)`
    grid-template-rows: 0.2fr 1fr 0.5fr 0.5fr;
    grid-template-areas:
        "header"
        "buttons"
        "queue";
    text-align: center;
    grid-gap: 0.25rem;

`;

const StyledSection = styled(Layout.Section)`
    margin-top: 8%;
    min-height: 600px;
`;

const dashboard: React.FunctionComponent<Props> = (props) => {
  return (
      <>
        <StyledSection>
            <StyledContainer>
                <div></div>

                <div>
                <Layout.GridContent>
                    <Text.H3>Add Appointment</Text.H3>
                
                    <Button.Default
                        onClick={props.onSave}
                    >Add</Button.Default>
                </Layout.GridContent>
                </div>
                
                <div></div>

            </StyledContainer>
        </StyledSection>
    </>
  )
}

export default dashboard;
